{\colortbl;\red255\green0\blue0;\red0\green0\blue255;}
\widowctrl\hyphauto

{\pard \ql \f0 \sa180 \li0 \fi0 \b \fs36 Maximum Resolution Dither\par}
{\pard \ql \f0 \sa180 \li0 \fi0 Strange noise shaped Dither. Dithers to a very high bit depth first, then reduces bit depth one bit at a time. If least significant bit is 0, truncate bit depth. If least significant bit is 1, probability of adding 1 bit onto next significant bit is 0.618 or 1 -0.618 depending on the signal polarity.\par}
}

